from itertools import count, islice
from math import comb
from sympy import factorint
def A334083_gen(): # generator of terms
    for n in count(0):
        m, flag = 1<<n, True
        for k in range(1,m):
            c = comb(m,k)
            if c > 1:
                l = (~c & c-1).bit_length()
                if l>0:
                    P = (1<<l+1)-1
                    for p, e in factorint(c>>l).items():
                        if p > 1+P:
                            flag = False
                            break
                        P *= (p**(e+1)-1)//(p-1)
                else:
                    flag = False
                    break
        if flag:
            yield m
